import React from "react";

const Header = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        fontSize: "30px"
      }}
    >
      <h3>Book List App</h3>
    </div>
  );
};

export default Header;
